const devices = $items().map(i => ({
  hostname: i.json.hostname,
  network_os: i.json.network_os,
  cdp_output: i.json.cdp_output,
}));

return [{ json: { devices } }];

let m = $json.content.parts[0].text || '';

// Limpiar posibles ```mermaid y ``` que meta el modelo
m = m.replace(/```mermaid/gi, '')
     .replace(/```/g, '')
     .trim();

return [{ json: { mermaid: m } }];

// Respuesta de /job_events
const events = $json.results || [];

// Unimos todos los msg de los eventos
let combined = '';
for (const e of events) {
  const msg = e?.event_data?.res?.msg;
  if (typeof msg === 'string') {
    combined += '\n' + msg;
  }
}

// Buscar bloques CDP_DATA_START / END
const items = [];
const regex = /CDP_DATA_START([\s\S]*?)CDP_DATA_END/gm;
let match;

while ((match = regex.exec(combined)) !== null) {
  const jsonText = match[1].trim();
  try {
    const obj = JSON.parse(jsonText);   // { hostname, network_os, cdp_output }
    items.push({ json: obj });
  } catch (e) {
    items.push({ json: { error: 'Failed to parse CDP JSON block', raw: jsonText } });
  }
}

if (items.length === 0) {
  return [{ json: { error: 'No CDP_DATA blocks found', raw: combined.slice(0, 1000) } }];
}

return items;

